(7443, 863, 'tours_program', 'a:3:{i:0;a:3:{s:5:\"title\";s:72:\"<span> 08:00 </span>See the impressive LA grid from atop Mount Hollywood\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:333:\"In 1972, the Urraco, which had experienced several initial slowdowns, was finally put into production. Almost inevitably, the S version also arrived in October of that year.\r\nIn this case, the goal was not to enhance the car\'s performance but to improve its overall quality, which had been neglected in the haste to start production.\";}i:1;a:3:{s:5:\"title\";s:65:\"<span> 10:00 </span>Exercise and burn calories while you sightsee\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:333:\"In 1972, the Urraco, which had experienced several initial slowdowns, was finally put into production. Almost inevitably, the S version also arrived in October of that year.\r\nIn this case, the goal was not to enhance the car\'s performance but to improve its overall quality, which had been neglected in the haste to start production.\";}i:2;a:3:{s:5:\"title\";s:78:\"<span> 12:00 </span> Leisurely hike in Griffith Park with panoramic city views\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:333:\"In 1972, the Urraco, which had experienced several initial slowdowns, was finally put into production. Almost inevitably, the S version also arrived in October of that year.\r\nIn this case, the goal was not to enhance the car\'s performance but to improve its overall quality, which had been neglected in the haste to start production.\";}}'),
