(7507, 864, 'tours_program', 'a:5:{i:0;a:3:{s:5:\"title\";s:41:\"<span> Day 1 </span> Arrive San Francisco\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:298:\"From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception\";}i:1;a:3:{s:5:\"title\";s:55:\"<span> Day 2 </span> San Francisco Sightseeing  Napa\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:277:\"Admire the eclectic mix of architecture, culture and cuisines of one of the world\'s most livable cities. Embark on a morning exploration that takes you from the lively tourist hotspot of Fisherman\'s Wharf to Union Square, a historical landmark linked to the American Civil War.\";}i:2;a:3:{s:5:\"title\";s:43:\"<span> Day 3 </span> Lake Tahoe Sightseeing\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:199:\"Enjoy a scenic drive through the Napa Valley area before boarding the Napa Valley Wine Train\'s lovingly restored Pullman cars for a taste of the golden age of rail travel and a enjoy a Regional Meal.\";}i:3;a:3:{s:5:\"title\";s:55:\"<span> Day 4 </span> Monterey, Carmel and 17-Mile Drive\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:198:\"The pinch me moments continue as we follow the sun-kissed California coast, cruising scenic 17-Mile Drive. We return to Monterey for a visit of Cannery Row, immortalised in the John Steinbeck novel.\";}i:4;a:3:{s:5:\"title\";s:71:\"<span> Day 5 </span> Monterey  Roaring Camp  Depart San Francisco\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:226:\"California\'s towering redwoods provide an imposing backdrop for this morning as we journey back in time to the era of lumberjacks and sawmills in a re-created 1890s logging camp, complete with general store and railroad depot.\";}}'),
(7508, 864, 'tours_faq', 'a:2:{i:0;a:2:{s:5:\"title\";s:34:\" Do you arrange airport transfers?\";s:4:\"desc\";s:291:\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\";}i:1;a:2:{s:5:\"title\";s:33:\"Nam at eius dissentias disputando\";s:4:\"desc\";s:300:\"Eum eu sumo albucius perfecto, commodo torquatos consequuntur pro ut, id posse splendide ius. Cu nisl putent omittantur usu, mutat atomorum ex pro, ius nibh nonumy id. In commune pericula mediocritatem per. Cu audiam dolorum appareat per, id habeo suavitate argumentum vel. Te his eros ludus tibique.\";}}'),
