(7589, 866, 'tours_program', 'a:5:{i:0;a:3:{s:5:\"title\";s:69:\"<span> 08:00 </span> The Hayden Planetarium Space Show: Dark Universe\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:308:\"Celebrates the pivotal discoveries that have led us to greater knowledge of the structure and history of the universe and our place in itand to new frontiers for exploration. Featuring exquisite renderings of enigmatic cosmic phenomena, seminal scientific instruments, and spectacular scenes in deep space\";}i:1;a:3:{s:5:\"title\";s:78:\"<span> 10:00 </span>Behold masterpieces by Gauguin, Dali, Picasso, and Pollock\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:309:\"The Museum of Modern Art is a place that fuels creativity, challenges minds, and provides inspiration. With extraordinary exhibitions and the world\'s finest collection of modern and contemporary art, MoMA is dedicated to the conversation between the past and the present, the established and the experimental.\";}i:2;a:3:{s:5:\"title\";s:75:\"<span> 12:00 </span> Enjoy free admission to all special exhibits and films\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:93:\"Purchase your admission and skip the lines to one of the world\'s most celebrated art museums.\";}i:3;a:3:{s:5:\"title\";s:52:\"<span> 14:00 </span>Receive a free pass to MoMA PS1 \";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:175:\"MoMA offers a panoramic overview of modern and contemporary art, from the innovative European painting and sculpture of the 1880s to today\'s film, design, and performance art.\";}i:4;a:3:{s:5:\"title\";s:79:\"<span> 16:00 </span> Behold masterpieces by Gauguin, Dali, Picasso, and Pollock\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:177:\"Celebrates the pivotal discoveries that have led us to greater knowledge of the structure and history of the universe and our place in itand to new frontiers for exploration.\";}}'),
