(7648, 865, 'tours_program', 'a:3:{i:0;a:3:{s:5:\"title\";s:26:\"<span> Day 1</span>In 1972\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:332:\"In 1972, the Urraco, which had experienced several initial slowdowns, was finally put into production. Almost inevitably, the S version also arrived in October of that year. In this case, the goal was not to enhance the car\'s performance but to improve its overall quality, which had been neglected in the haste to start production.\";}i:1;a:3:{s:5:\"title\";s:49:\"<span> Day 2 </span>Which had experienced several\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:332:\"In 1972, the Urraco, which had experienced several initial slowdowns, was finally put into production. Almost inevitably, the S version also arrived in October of that year. In this case, the goal was not to enhance the car\'s performance but to improve its overall quality, which had been neglected in the haste to start production.\";}i:2;a:3:{s:5:\"title\";s:36:\"<span> Day 3</span>Almost inevitably\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:332:\"In 1972, the Urraco, which had experienced several initial slowdowns, was finally put into production. Almost inevitably, the S version also arrived in October of that year. In this case, the goal was not to enhance the car\'s performance but to improve its overall quality, which had been neglected in the haste to start production.\";}}'),
