(8186, 903, 'tours_faq', 'a:2:{i:0;a:2:{s:5:\"title\";s:34:\" When and where does the tour end?\";s:4:\"desc\";s:267:\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\";}i:1;a:2:{s:5:\"title\";s:35:\"When and where does the tour start?\";s:4:\"desc\";s:356:\" \r\nDay 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\";}}'),
