(9132, 975, 'tours_program', 'a:3:{i:0;a:3:{s:5:\"title\";s:65:\"<span> 08:00 </span>Start in Los Angeles and end in San Francisco\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:377:\"Start in Los Angeles and end in San Francisco! With the adventure tour Western Express Northbound, you have a 4day tour package taking you from Los Angeles to San Francisco and through Los Angeles, USA and 7 other destinations in USA. Western Express Northbound is a small group tour that includes accommodation in a hotel as well as an expert guide, meals, transport and more.\";}i:1;a:3:{s:5:\"title\";s:57:\"<span> 10:00 </span>Western Express Northbound is a small\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:377:\"Start in Los Angeles and end in San Francisco! With the adventure tour Western Express Northbound, you have a 4day tour package taking you from Los Angeles to San Francisco and through Los Angeles, USA and 7 other destinations in USA. Western Express Northbound is a small group tour that includes accommodation in a hotel as well as an expert guide, meals, transport and more.\";}i:2;a:3:{s:5:\"title\";s:40:\"<span> 14:00 </span> Transport and more.\";s:5:\"image\";s:0:\"\";s:4:\"desc\";s:377:\"Start in Los Angeles and end in San Francisco! With the adventure tour Western Express Northbound, you have a 4day tour package taking you from Los Angeles to San Francisco and through Los Angeles, USA and 7 other destinations in USA. Western Express Northbound is a small group tour that includes accommodation in a hotel as well as an expert guide, meals, transport and more.\";}}'),
